import react from "react";
import ReactDOM from "react-dom/client";
import "./style.css";
import one from "./assets/images/one.jpg";
import two from "./assets/images/two.jpg";
import three from "./assets/images/three.jpg";
const root = ReactDOM.createRoot(document.getElementById("root"));
// Navbar Component
function Navbar() {
  return (
    <nav>
      <h1>Perfumy</h1>
      <ul>
        <li>Home |</li>
        <li>Product |</li>
        <li>About Us |</li>
        <li>Contact Us |</li>
      </ul>
    </nav>
  );
}
// Search Component
function Search() {
  return (
    <div className="searchbar">
      <input type="text" placeholder="Search" />
    </div>
  );
}
// Products Component
function Products() {
  return (
    <div className="products">
      <div className="box">
        <img src={one} alt="Img" />
        <p>Fogg Wood Extreme, Eau De Parfum, Long-lasting Perfume, 100ml</p>
      </div>
      <div className="box">
        <img src={two} alt="Img" />
        <p>Fogg Wood Extreme, Eau De Parfum, Long-lasting Perfume, 100ml</p>
      </div>
      <div className="box">
        <img src={three} alt="Img" />
        <p>Fogg Wood Extreme, Eau De Parfum, Long-lasting Perfume, 100ml</p>
      </div>
    </div>
  );
}
// About Component
function About(){
  retrun
}
root.render(
  <div>
    <Navbar></Navbar>
    <Search></Search>
    <Products></Products>
  </div>
);
